

def num_primorial(n):
    # this seems to be only good for smaller numbers.
    count = 0
    num = 1
    res = 1

    while count < n:
        r = range(2, 10)
        num += 1
        if  2 <= num <= 9:
            r.remove(num)
            if all(num % i != 0 for i in r):
                res *= num
                count += 1
        elif all(num % i != 0 for i in r):
            res *= num
            count += 1
        
    return long(res)

def is_prime(num):
    # check if a given number is prime:
    # num should be greater than or equal to 2
    i = 2
    while i < num:
        if num % i == 0:
            return False
        i += 1
    return True


def num_primorial2(n):
    res = 1
    start = 2
    count = 0

    while count < n:
        if is_prime(start):
            res *= start
            count += 1
        start += 1

    return res




